import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Link, Switch, Redirect } from 'react-router-dom'
import LoginForm from './MainComponents/LoginForm';


function App() {
  return (
    <>
    <Switch>
      <Route path = '/login'>
          <LoginForm/>
      </Route>
    </Switch>
    </>
  );
}

export default App;
